"original": |2-
     Each ACK Range consists of alternating Gap and ACK Range Length
     values in descending packet number order.  ACK Ranges can be
     repeated.  The number of Gap and ACK Range Length values is
     determined by the ACK Range Count field; one of each value is present
     for each value in the ACK Range Count field.
"fixed": |-
  Each ACK Range consists of alternating Gap and ACK Range Length values in descending packet number order.  ACK Ranges can be repeated.  The number of Gap and ACK Range Length values is determined by the ACK Range Count field; one of each value is present for each value in the ACK Range Count field.
"ko": |-
  각 ACK 범위는 패킷 번호 내림차순으로 교대로 반복되는 Gap 및 ACK 범위 길이 값으로 구성됩니다. ACK 범위는 반복될 수 있습니다. Gap 및 ACK Range Length 값의 수는 ACK Range Count 필드에 의해 결정됩니다. ACK 범위 카운트 필드의 각 값에 대해 각 값 중 하나가 존재합니다.
